import React from "react";

const CarList = ({ cars, onEdit, onDelete }) => {
  return (
    <div className="car-list">
      <h2>Car List</h2>
      <ul>
        {cars.map((car) => (
          <li key={car._id}>
            <strong>{car.brand} {car.model}</strong> ({car.year}) - ${car.price}
            <p>{car.description}</p>
            <img src={car.image} alt={`${car.brand} ${car.model}`} style={{ width: '100px' }} />
            <button onClick={() => onEdit(car)}>Edit</button>
            <button onClick={() => onDelete(car._id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CarList;
